package com.rongke.yinshengbao.entity;//订单状态查询接口public class OrderQuerySend {	private String accountId;    //商户编号	private String orderId;		//订单号	private String mac;			//数字签名	private String key;	/**	 * 商户编号	 * @return	 */	public String getAccountId() {		return accountId;	}	/**	 * 商户编号	 * @param accountId	 */	public void setAccountId(String accountId) {		this.accountId = accountId;	}	/**	 * 订单号	 * @return	 */	public String getOrderId() {		return orderId;	}	/**	 * 订单号	 * @param orderId	 */	public void setOrderId(String orderId) {		this.orderId = orderId;	}	/**	 * 数字签名	 * @return	 */	public String getMac() {		return mac;	}	/**	 * 数字签名	 * @param mac	 */	public void setMac(String mac) {		this.mac = mac;	}		/**	 * @return the key	 */	public String getKey() {		return key;	}	/**	 * @param key the key to set	 */	public void setKey(String key) {		this.key = key;	}	/* (non-Javadoc)	 * @see java.lang.Object#toString()	 */	@Override	public String toString() {		return "accountId=" + accountId + "&orderId="				+ orderId + "&key=" + key;	}}